import { Typography } from "@material-ui/core";
import React from "react";
import BarChart from "./BarChart";
import PieChart from "./PieChart";
import ReactPlayer from "react-player/youtube";
import homeImage from "./images/homeImage.jpg";
import paddle from "./images/paddle.png";
import { homeStyles } from './Home-styles';
import Carousel from './carousel';

export default function Home() {


  const classes = homeStyles();
  return (
    <div>
      <div >


      </div>

      <div
        style={{
          display: "flex",
          width: "100%",
          height: "100%",
          flexFlow: "column",
          alignItems: "center",
        }}
      >
        <div
        style={{
          display: "flex",
          justifyContent:"space-between",
          flexFlow: "row"
        }}>
         <div className="section">
          <img src={homeImage} className={classes.homeImage} alt={"homeImage"} width="100%"/>
        </div>

        </div>
        <div
          className="ChartsHolder"
          style={{ display: "flex", 
          justifyContent: "space-between" }}
        >

          <div
          className="playerContainer"
          style={{ display: "flex", width: "500px" }}
        >
          <ReactPlayer
            url="https://www.youtube.com/watch?v=TAEkR13ChPs"
            stopOnUnmount={false}
            playing="false"
            width="100%"
            height="20em"
            style={{
              display: 'flex',
              marginTop: '50px'
            }}
          />
        </div>
          <div style={{
            display: "flex",
            marginLeft: "200px"}}>
            <PieChart />
          </div>

        </div><div>
        <Carousel />
        <div style={{
            display: "flex",
            marginLeft: "-200px"}}>
            <BarChart />
            </div>
          </div>
      </div>
    </div>
  );
}
